console.log({BrandsNav})

return (
	<div className={classes.wrapper}>
		<div className ={classes.brands}>
  	<div className={classes.zalupa}>{BrandsNav.title}</div>
		<p>POMAGITE MNEEEEE</p>
		
	  </div>
	</div>

)

}




export default Brands;












